// HasOtp applies the HasEdge predicate on the "otp" edge.
func HasOtp() predicate.User {
	return predicate.User(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(OtpTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, OtpTable, OtpColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasOtpWith applies the HasEdge predicate on the "otp" edge with a given conditions (other predicates).
func HasOtpWith(preds ...predicate.UserOtp) predicate.User {
	return predicate.User(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(OtpInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, OtpTable, OtpColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

